import { Fragment } from "react";
import classes from "./Header.module.css";
import HeaderCartButton from "./HeaderCartButton";
import underwater from "../../assets/underwater.jpg";

$(function () {
  $("a[href*=#]").on("click", function (e) {
    e.preventDefault();
    $("html, body").animate(
      { scrollTop: $($(this).attr("href")).offset().top },
      500,
      "linear"
    );
  });
});

const Header = (props) => {
  return (
    <Fragment>
      <header className={classes.header}>
        <h1>Evening View</h1>
        <HeaderCartButton onClick={props.onShownCart} />
      </header>
      <div className={classes.div}>
        <img className={classes.img} src={underwater}></img>
        <h2 className={classes.title}>Choose Your Favourite Cocktail</h2>
        <section className={`${classes.section04} ${classes.demo}`}>
          <a href="#section05">
            <span></span>Scroll
          </a>
        </section>
      </div>
    </Fragment>
  );
};

export default Header;
